#include "attachments/read_file.h"
#include <stdlib.h>
#include <unistd.h>

struct FileContent read_file(int fd) {
    struct FileContent result;
    char *buf = calloc(4096, 1);
    char *cur_buf = buf;
    size_t file_size = 0;
    ssize_t read_res = 1;
    while (read_res > 0) {
        read_res = read(fd, &cur_buf, sizeof(buf));
        file_size += read_res;
        cur_buf += read_res;
        if (file_size >= 4095) {
            result.size = -1;
            result.data = NULL;
            free(buf);
            return result;
        }
    }

    if (read_res == 0) {
        *cur_buf = 0;
        result.size = file_size;
        result.data = buf;
        return result;
    } else {
        result.size = -1;
        result.data = NULL;
        return result;
    }
}

