void  reverseWord(const string & str, ostream & ostr) {
	
	size_t c = str.length()-1;
	
	for (;;) {

		ostr << str[c];

		if (c) {
			c--;
		}
		else
			break;
	}
}


int main(void)
{
	ostringstream result;

	
	while(true) {
				
		string str;	
		cin >> str;
		
		if (str == "End") {
			break;
		}

		result << str << " = ";
		reverseWord(str, result);
		result << endl;
	}
	cout << result.str();

}

