#include <bits/stdc++.h>

using namespace std;

int dx[] = {0, -1, 0, 1};
int dy[] = {1, 0, -1, 0};

// right, up, left, down

const int N = 1000;

int dp[N][N][4][10];

using node = tuple<int, int, int, int, int>;

int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(nullptr);
    freopen("in.txt", "r", stdin);
    freopen("out.txt", "w", stdout);
    memset(dp, 63, sizeof(dp));
    string s;
    vector<string> v;
    while(cin >> s) v.push_back(s);
    int n = v.size(), m = v[0].size();
    for(int i = 0; i < 4; i++) {
        dp[0][0][i][0] = 0;
    }
    priority_queue<node, vector<node>, greater<node>> pq;
    pq.emplace(0, 0, 0, 0, 0);
    pq.emplace(0, 0, 0, 3, 0);
    int ans = INT_MAX;
    while(!pq.empty()) {
        auto [k, a, b, c, d] = pq.top(); pq.pop();
        if(a == n - 1 and b == m - 1) {
            ans = min(ans, k);
        }
        if(dp[a][b][c][d] != k) continue;
        if(d < 3) {
            int x = a + dx[c], y = b + dy[c];
            if(x >= 0 and x < n and y >= 0 and y < m and dp[x][y][c][d + 1] > k + v[x][y] - '0') {
                dp[x][y][c][d + 1] = k + v[x][y] - '0';
                pq.emplace(dp[x][y][c][d + 1], x, y, c, d + 1);
            }
            continue;
        }
        if(d < 9) {
            int x = a + dx[c], y = b + dy[c];
            if(x >= 0 and x < n and y >= 0 and y < m and dp[x][y][c][d + 1] > k + v[x][y] - '0') {
                dp[x][y][c][d + 1] = k + v[x][y] - '0';
                pq.emplace(dp[x][y][c][d + 1], x, y, c, d + 1);
            }
        }
        int l = (c - 1 + 4) % 4, r = (c + 1) % 4;
        int x = a + dx[l], y = b + dy[l];
        if(x >= 0 and x < n and y >= 0 and y < m and dp[x][y][l][0] > k + v[x][y] - '0') {
            dp[x][y][l][0] = k + v[x][y] - '0';
            pq.emplace(dp[x][y][l][0], x, y, l, 0);
        }
        x = a + dx[r], y = b + dy[r];
        if(x >= 0 and x < n and y >= 0 and y < m and dp[x][y][r][0] > k + v[x][y] - '0') {
            dp[x][y][r][0] = k + v[x][y] - '0';
            pq.emplace(dp[x][y][r][0], x, y, r, 0);
        }
    }
    cout << ans << "\n";
    return 0;
}

var map = File.ReadAllLines("input.txt").Select(s => s.Select(c => int.Parse(c.ToString())).ToArray()).ToArray();

var queue = new PriorityQueue<Path, int>();
var visited = new HashSet<string>();

queue.Enqueue(new Path(new(0, 0), Direction.Right, 0), 0);

var totalHeat = 0;

while (queue.Count > 0)
{
    var path = queue.Dequeue();
    
    if (path.Position.Row == map.Length - 1 && path.Position.Col == map[0].Length - 1)
    {
        totalHeat = path.Heat;
        break;
    }

    if (path.Distance < 3)
    {
        TryMove(path, path.Direction);
    }

    TryMove(path, path.Direction.TurnLeft());
    TryMove(path, path.Direction.TurnRight());
}

Console.WriteLine($"Part 1: {totalHeat}");

queue.Clear();
queue.Enqueue(new Path(new(0, 0), Direction.Right, 0), 0);
queue.Enqueue(new Path(new(0, 0), Direction.Down, 0), 0);
totalHeat = 0;
visited.Clear();

while (queue.Count > 0)
{
    var path = queue.Dequeue();
    if (path.Position.Row == map.Length - 1 && path.Position.Col == map[0].Length - 1)
    {
        totalHeat = path.Heat;
        break;
    }

    if (path.Distance < 10)
    {
        TryMove(path, path.Direction);
    }

    if (path.Distance >= 4)
    {
        TryMove(path, path.Direction.TurnLeft());
        TryMove(path, path.Direction.TurnRight());
    }
}

Console.WriteLine($"Part 2: {totalHeat}");
return;

void TryMove(Path path, Direction direction)
{
    var candidate = new Path(path.Position.Move(direction), direction, direction == path.Direction ? path.Distance + 1 : 1);

    if (candidate.Position.Row < 0 || candidate.Position.Row >= map.Length ||
        candidate.Position.Col < 0 || candidate.Position.Col >= map[0].Length)
    {
        return;
    }

    var key = $"{candidate.Position.Row},{candidate.Position.Col},{candidate.Direction.Row},{candidate.Direction.Col},{candidate.Distance}";
    if (visited.Contains(key))
    {
        return;
    }

    visited.Add(key);

    candidate.Heat = path.Heat + map[candidate.Position.Row][candidate.Position.Col];
    queue.Enqueue(candidate, candidate.Heat);
}

internal class Path(Position position, Direction direction, int distance)
{
    public readonly Position Position = position;
    public readonly Direction Direction = direction;
    public readonly int Distance = distance;
    public int Heat { get; set; }
}

internal class Direction(int row, int col)
{
    public readonly int Row = row;
    public readonly int Col = col;

    public Direction TurnLeft()
    {
        return new Direction(-Col, Row);
    }

    public Direction TurnRight()
    {
        return new Direction(Col, -Row);
    }

    public static Direction Up = new(-1, 0);
    public static Direction Down = new(1, 0);
    public static Direction Left = new(0, -1);
    public static Direction Right = new(0, 1);
}

internal class Position(int row, int col)
{
    public readonly int Row = row;
    public readonly int Col = col;
    
    public Position Move(Direction dir)
    {
        return new Position(Row + dir.Row, Col + dir.Col);
    }
}

