export default function CreateProduct() {
    const [newProduct, setNewProduct] = useState(
        {
            image:'', 
            name:'',
            brand:'',
            price:'',
            description:''
        }
    )
    const navgigate = useNavigate()
    const url = 'http://127.0.0.1:8000/create/'

    const handleSubmit = async(e) => {
        e.preventDefault()

        const formData = new FormData()
        formData.append("image", newProduct.image[0])
        formData.append("name", newProduct.name)
        formData.append("brand", newProduct.brand)
        formData.append("price", newProduct.price)
        formData.append("description", newProduct.description)

       try {
            const data = await addProduct(url, formData)
            navgigate('/', {replace:true})
       } catch (err) {
            const error = {name:err.name, message:err.message}
            console.log(error)
       }
    }

    const handleChange = (e) => {
        const {name, value} = e.target
        if(name === 'image'){
            setNewProduct((prev)=>({...prev, [name]:e.target.files}))
        }else {
            setNewProduct((prev) => ({...prev, [name]:value}))
        }
    }

    return (
        <div style={formContainer}>
             <form style={form} onSubmit={handleSubmit}>
                <input type='file'onChange={handleChange} accept='image/*' name='image'/>
                <input style={input} onChange={handleChange} value={newProduct.name} type="text" name='name' placeholder='Name'/>
                <input style={input} onChange={handleChange} value={newProduct.brand} type="text" name='brand' placeholder='Brand'/>
                <input style={input} onChange={handleChange} value={newProduct.price} type="number" name='price' step='0.01' placeholder='Price'/>
                <textarea style={textArea} onChange={handleChange} value={newProduct.description} name="description" id="" cols="30" rows="10" placeholder='Description'></textarea>
                <button type='submit' style={button}>Submit</button>
            </form>
        </div>
    )
}

if (this.ShouldBeDowned())
{
