function getCitizens()
    citizens = "\n"
    for i, citizensNames in pairs(colony.getCitizens()) do
        citizens = citizens .. citizensNames.name .. "\n"
        formattedMessage = {
            {text = citizens, color = "green"}
        }
    end
    SendJsonPrivate(formattedMessage)
end

function getHappiness()
    happiness = colony.getHappiness()
    -- red < 3 under --yellow <8 --green < 10
    if happiness < 3 then
        formattedMessage = {
            {text = happiness, color = "red"}
        }
    elseif happiness < 8 then
        formattedMessage = {
            {text = happiness, color = "yellow"}
        }
    else
        formattedMessage = {
            {text = happiness, color = "green"}
        }
    end
    SendJsonPrivate(formattedMessage)
end

function SendJsonPrivate(formattedMEssage)
    local json = textutils.serialiseJSON(formattedMessage)
